import React, {useState, useEffect} from 'react';
import axios from 'axios';
import "./Home.css";

const Home = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios.get("http://localhost:3006/");
      console.log(response.data.books);
      setData(response.data.books);
    };
    fetchData();
  }, []);
  return (
    <>
      <h1>this is the homepage</h1>
      <h2>{data && data.name} </h2>
      <LoggedIn {...loggedInData} />
    </>
  );
};

function LoggedIn(props) {
  const { overlapGroup4, logo, study_Cat, coding_Cat, backhome1, loggedin_Cat1, floatingbook1, readStudy, code1, quizYourself } = props;

  return (
    <div className="container-center-horizontal">
      <div className="homescreen">
        <div className="overlap-group4" style={{ backgroundImage: `url(${overlapGroup4})` }}>
          <div className="group-35">
            <img className="logo" src={logo} />
            <div className="overlap-group">
              <div className="ellipse-4"></div>
              <img className="study_cat" src={study_Cat} />
            </div>
            <div className="overlap-group1">
              <div className="ellipse-1"></div>
              <div className="ellipse-2"></div>
              <img className="coding_cat" src={coding_Cat} />
              <img className="backhome-1" src={backhome1} />
            </div>
          </div>
          <div className="overlap-group-container">
            <div className="overlap-group5">
              <img className="loggedin_cat-1" src={loggedin_Cat1} />
              <img className="floatingbook-1" src={floatingbook1} />
              <div className="overlap-group2">
                <h1 className="titlevalign-text-middlepoppins-normal-white-25px">
                  {readStudy}
                </h1>
              </div>
            </div>
            <div className="overlap-group6">
              <img className="code-1" src={code1} />
              <div className="overlap-group3">
                <div className="quiz-yourselfvalign-text-middlepoppins-normal-white-25px">
                  {quizYourself}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

const loggedInData = {
  overlapGroup4: "page-background.png",
  logo: "logo-2.png",
  study_Cat: "study-cat.png",
  coding_Cat: "coding-cat.png",
  backhome1: "back-1-1.png",
  loggedin_Cat1: "loggedin-cat-1.png",
  floatingbook1: "floatingbook-1.png",
  readStudy: "Read & Study",
  code1: "code-1.png",
  quizYourself: "Quiz Yourself",
};

export default Home;
